import styled from "styled-components";

export const ModalStyle = styled.div`

    .modal {
        margin-top: -20px;
        margin-left: 15%;
        width: 50vw;
        height: 90vh;
        border: solid 5px black;
        background: #555;
        z-index: 10;
        position: fixed;
        border-radius: 10px;
        display: flex;
        flex-direction: column;
    }

    & svg {
        margin-left: 100px;
        margin-top: 5px;
        align-self: end;
    }



`
